import React from 'react';



const Greeting = () => {

    return(
        <div>
            <h1>Welcome to the LEVEL UP APP!</h1>
            <p>Start leveling up today by signing up!</p>
            <button>Login</button>
            <button>Sign Up</button>
        </div>
    )

}


export default Greeting;
